$(document).ready(function () {

    //Init Seedout icheck control

    // Image viewer JS Initialize
    $(function () {

        $('.gallery-items').click(function () {
            var viewer = ImageViewer();
            var imgSrc = this.src,
                highResolutionImage = $(this).data('high-res-img');

            viewer.show(imgSrc, highResolutionImage);
        });
    });

    /*Sweet Alert Init*/
    $('.sweetalert').on("click", function () {
        var s_title = (this.attr('data-title') == '') ? "Are you sure?" : this.attr('data-title');
        var s_confirmation = (this.attr('data-confirmation') == '') ? "You want to delete!" : this.attr('data-confirmation');
        swal({
                title: s_title,
                text: s_confirmation,
                type: "warning",
                showCancelButton: true,
                confirmButtonColor: '#DD6B55',
                confirmButtonText: 'Yes, delete it!',
                cancelButtonText: "No, cancel plx!",
                closeOnConfirm: false,
                closeOnCancel: false
            },
            function (isConfirm) {
                if (isConfirm) {
                    swal("Deleted!", "Your imaginary file has been deleted!", "success");
                } else {
                    swal("Cancelled", "Your imaginary file is safe :)", "error");
                }
            });
    });

    //Initiate the mask prototype
    InitMaskedInput();
});
function InitMaskedInput() {
    /*https://igorescobar.github.io/jQuery-Mask-Plugin/*/
    $(function () {
        $('.mask_number').mask('000000000000000');
        $('.mask_cnic').mask('00000-0000000-0');
        $('.mask_date').mask('00/00/0000');
        $('.mask_time').mask('00:00:00');
        $('.mask_date_time').mask('00/00/0000 00:00:00');
        $('.mask_cep').mask('00000-000');
        $('.mask_phone').mask('0000-0000');
        $('.mask_phone_with_ddd').mask('(00) 0000-0000');
        $('.mask_phone_us').mask('(000) 000-0000');
        $('.mask_project_id').mask('0000-SSS');
        $('.mask_ip_address').mask('099.099.099.099');
        $('.mask_percent').mask('##0,00%', {reverse: true});
        $('.mask_clear-if-not-match').mask("00/00/0000", {clearIfNotMatch: true});
        // zz is now optional
        $('.mask_age').mask("0ZZ SSSSSS", {translation:  {'Z': {pattern: /[0-9]/, optional: true}}});


        $('.mask_money').mask('##,###,###,###,###,###.00',{reverse: true});
        //$('.mask_money').mask('#.##0,00', {reverse: true});

        var SPMaskBehavior = function (val) {
                return val.replace(/\D/g, '').length === 11 ? '+00000000000' : '+00000000000';
            },
            spOptions = {
                onKeyPress: function (val, e, field, options) {
                    field.mask(SPMaskBehavior.apply({}, arguments), options);
                }
            };

        $('.mask_celphone').mask(SPMaskBehavior, spOptions);

    });
}
/*Pass a classname of array and get its values comma separated*/
function commaseparatedstring(classname) {
    var boxes = document.getElementsByClassName(classname);
    var checked = [];
    for (var i = 0; boxes[i]; ++i) {
        if (boxes[i].checked) {
            checked.push(boxes[i].value);
        }
    }
    var checkedStr = checked.join(',');
    return checkedStr;
}
